  expected_count: 4
  input: TEXT,F3XA,,"The PAC bank account originally allowed ACH transfers by the
    collecting agent for the automatic deposit of payroll deductions. In March and
    April the collecting agent experienced a programming error which resulted in a
    double deposit of payroll deductions, one in March and two in April. In an effort
    to resolve the situation, on its own initiative, the collecting agent withheld
    payroll deductions in the month of May a month with three payroll periods.  The
    PAC was not made aware of the programming error at the time the collecting agent
    had attempted to remedy the situation.  Once the PAC officials became aware of
    the programming error, ACH transfers for payroll deductions were halted and efforts
    were made to prohibit this error from being replicated.  On October 10, 2002,
    the PAC refunded to the collecting agent $362.08 (total for one payroll deduction
    pay period) for the March programming error and $724.16 (total for the two payroll
    periods in April). Further, the May report has been amended to reflect that no
    payroll deductions were made by the PAC."
